import React, { useContext } from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
  return (
    <>
      <NavLink activeClassName='active_class' exact to='/'>About</NavLink>
      <NavLink activeClassName='active_class' exact to='/contact'>Contact</NavLink>
      <NavLink activeClassName='active_class' to='/service'>Service</NavLink>
      <NavLink activeClassName='active_class' exact to='/user'>User</NavLink>
    </>
  );
};
export default Menu;
